"use strict";

function rotateGrid(grid, k) {
    function rotate(grid, s1, e1, s2, e2, k) {
        let t = [];
        for (let j = e2; j > e1; j--) {
            t.push(grid[s1][j]);
        }
        for (let i = s1; i < s2; i++) {
            t.push(grid[i][e1]);
        }
        for (let j = e1; j < e2; j++) {
            t.push(grid[s2][j]);
        }
        for (let i = s2; i > s1; i--) {
            t.push(grid[i][e2]);
        }
        k %= t.length;
        t = t.slice(-k).concat(t.slice(0, -k));
        k = 0;
        for (let j = e2; j > e1; j--) {
            grid[s1][j] = t[k];
            k += 1;
        }
        for (let i = s1; i < s2; i++) {
            grid[i][e1] = t[k];
            k += 1;
        }
        for (let j = e1; j < e2; j++) {
            grid[s2][j] = t[k];
            k += 1;
        }
        for (let i = s2; i > s1; i--) {
            grid[i][e2] = t[k];
            k += 1;
        }
    }
    let m = grid.length, n = grid[0].length;
    let s1 = e1 = 0;
    let s2 = m - 1, e2 = n - 1;
    while (s1 <= s2 && e1 <= e2) {
        rotate(grid, s1, e1, s2, e2, k);
        s1 += 1;
        e1 += 1;
        s2 -= 1;
        e2 -= 1;
    }
    return grid;
}
